import React from "react";

const ToDolist = ()=>{
    return(
        <>
            <div className="container">
                <div className="main-container">
                    <h1> ToDolist </h1>
                    <input type="text" placeholder="enter an item"/>
                    <button> + </button>
                </div>
            </div>
        </>
    )

}


export default ToDolist;
